import YelpIcon from "../images/yelpIcon.png";

const YelpComp = ({ yelpData }) => {
  const yelpStyles = {
    Width: "20px",
  };

  return (
    <div style={{ color: "white" }}>
      <img
        className="bg-slate-100 pl-20 pr-20 rounded-lg"
        src={YelpIcon}
        alt=""
        style={yelpStyles}
      />
      {yelpData.map((data) => {
        return (
          <div>
            <h1>{data.name}</h1>
            <p>{data.location}</p>
            <p>{data.date_created}</p>
            <img src={data.image} alt="" />
          </div>
        );
      })}
    </div>
  );
};
export default YelpComp;
